import java.io.*;
import java.util.Arrays;
import java.util.zip.DataFormatException;
import java.util.zip.Inflater;
// import sun.misc.BASE64Decoder;

class Base64 {
    static String s = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/";

    static byte[] decode(byte[] from) {
        byte[] to = new byte[from.length];
        int n = 0;
        for (int i = 0; i < from.length; i += 4) {
            int c = 0;
            for (int j = i; j < i + 4; ++j) {
                c <<= 6;
                if (from[j] != '=') {
                    c |= s.indexOf(from[j]);
                }
            }
            to[n] = (byte)(c >> 16);
            to[n + 1] = (byte)((c >> 8) & 255);
            to[n + 2] = (byte)(c & 255);
            n += 3;
        }
        if (from[from.length / 4 * 4 - 2] == '=') {
            n -= 2;
        } else if (from[from.length / 4 * 4 - 1] == '=') {
            n -= 1;
        }
        return Arrays.copyOfRange(to, 0, n);
    }
};

public class Main {
    public static void main(String[] args) throws IOException, DataFormatException {
//      sum.misc.BASE64Decoder will get RuntimError at ZOJ
//      BASE64Decoder base64 = new BASE64Decoder();
//      byte[] data = base64.decodeBuffer(str);
        byte[] data = Base64.decode(str.getBytes());

        Inflater decompresser = new Inflater();
        decompresser.setInput(data);
        byte[] result = new byte[65536];
        int size = decompresser.inflate(result);
        decompresser.end();

        BufferedReader list = new BufferedReader(new InputStreamReader(new ByteArrayInputStream(result, 0, size)));
        String[] title = new String[4096];
        for (int i = 1001; i <= 3436; ++i) {
            title[i] = list.readLine();
        }
        title[2867] = title[3000] = "No such problem";

        BufferedReader in = new BufferedReader(new InputStreamReader(System.in));
        String line;
        while ((line = in.readLine()) != null) {
            try {
                int code = Integer.parseInt(line);
                if (line.length() == 4 && 1001 <= code && code <= 3436) {
                    System.out.println(title[code]);
                } else {
                    System.out.println("No such problem");
                }
            } catch (Exception e) {
                System.out.println("No such problem");
            }
        }
    }

    static String str = "";
}

